import React, { useEffect, useState} from "react";
import Peak from "../Peak/Peak";
import s from "./PeakContainer.module.css";

const MountainContainer = ({ peakData }) => {
    const [peaks, setPeaks] = useState([]);

    useEffect(() => {
        setPeaks(peakData);
    }) 


    return (
        <div className={s.peakContainer}>
            {
                peaks.length ? peaks.map((peak) => (
                    <Peak
                        key={peak.id}
                        peak={peak}
                    />
                ))
                : <div>Something went wrong. Nno peaks.</div>
            }

        </div>
    )
}

export default MountainContainer;
